// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/math/SafeMath.sol";
import "@openzeppelin/contracts/utils/Address.sol";
import "@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol";

contract CommunityRewardsApprove is Ownable {
    using SafeMath for uint256;
    using SafeERC20 for IERC20;

    event releaseEvent(address wallet, address account, uint256 amount);

    IERC20 public token;
    address public tokenWallet;

    address[] private _memberList;

    struct RewardsInfo {
        address rewardsToken;
        uint256 rewardsAmount;
    }

    struct ReportInfo {
        address token;
        uint256 amount;
    }

    mapping(address => RewardsInfo) private _rewardsList;

    constructor(IERC20 _token, address _tokenWallet) Ownable() {
        require(address(_token) != address(0), "CommunityRewards: token is the zero address");
        require(_tokenWallet != address(0), "CommunityRewards: The token wallet is the zero address");

        token = _token;
        tokenWallet = _tokenWallet;
    }

    /**
     * @dev set token wallet
     */
    function setTokenWallet(address newTokenWallet) public onlyOwner {
        require(newTokenWallet != address(0), "CommunityRewards: The new token wallet is the zero address");
        require(!Address.isContract(newTokenWallet), "CommunityRewards: The new token wallet cannot be a contract address");
        tokenWallet = newTokenWallet;
    }

    /**
     * @dev get _memberList
     */
    function getMemberList() public onlyOwner view returns (address[] memory) {
        return _memberList;
    }

    /**
     * @dev get rewards info from the rewardsList
     */
    function getRewardsInfoByAccountForAdmin(address account) public onlyOwner view returns (RewardsInfo memory) {
        return _rewardsList[account];
    }

    /**
     * @dev get rewards info from the rewardsList
     */
    function getRewardsInfoByAccount() public view returns (RewardsInfo memory) {
        return _rewardsList[msg.sender];
    }

    /**
     * @dev upload account rewardsAmount
     * @param rewardsToken the token of rewards
     * @param rewardsAmount the amount of update
     */
    function updateRewardsAmount(address rewardsToken, uint256 rewardsAmount) public onlyOwner {
        // Not is 0x address
        require(rewardsToken != address(0), 'CommunityRewards: reward to the zero address');
        // the rewardsAmount must be gte zero
        require(rewardsAmount >= 0, 'CommunityRewards: the balance is less than zero');

        RewardsInfo storage info = _rewardsList[rewardsToken];
        if (info.rewardsToken != address(0)) {
            info.rewardsAmount = rewardsAmount;
        } else {
            _rewardsList[rewardsToken] = RewardsInfo(rewardsToken, rewardsAmount);
            _memberList.push(rewardsToken);
        }
    }

    /**
     * @dev upload report to update rewards list data
     * @param list upload data array
     */
    function updateRewardsList(ReportInfo[] memory list) public onlyOwner {
        require(list.length > 0, "CommunityRewards: list array is null");
        for (uint i = 0; i < list.length; i++) {
            ReportInfo memory reportInfo = list[i];
            if (reportInfo.amount > 0) {
                _addRewardsTokens(reportInfo.token, reportInfo.amount);
            }
        }
    }

    /**
     * @dev add rewards list data
     * @param rewardsToken the token of rewards
     * @param rewardsAmount the amount of update
     */
    function _addRewardsTokens(address rewardsToken, uint256 rewardsAmount) internal {
        RewardsInfo storage info = _rewardsList[rewardsToken];
        if (info.rewardsToken != address(0)) {
            info.rewardsAmount = info.rewardsAmount.add(rewardsAmount);
        } else {
            _rewardsList[rewardsToken] = RewardsInfo(rewardsToken, rewardsAmount);
            _memberList.push(rewardsToken);
        }
    }

    /**
     * @dev admin release
     * @param rewardsToken the token of rewards
     * @param releaseAmount the amount of release
     */
    function releaseByAdmin(address rewardsToken, uint256 releaseAmount) public onlyOwner {
        _release(rewardsToken, releaseAmount);
    }

    /**
     * @dev self getReward
     * @param getRewardAmount the amount of getReward
     */
    function getReward(uint256 getRewardAmount) public {
        _release(msg.sender, getRewardAmount);
    }

    /**
     * @dev common release function
     * @param rewardsToken the token of rewards
     * @param releaseAmount the amount of release
     */
    function _release(address rewardsToken, uint256 releaseAmount) internal {
        // Not is 0x address
        require(rewardsToken != address(0), 'CommunityRewards: release from the zero address');
        RewardsInfo storage info = _rewardsList[rewardsToken];
        // the releaseAmount must be gt zero
        require(releaseAmount > 0, 'CommunityRewards: the balance is zero');
        // the balance must be gt zero
        require(info.rewardsAmount > 0, 'CommunityRewards: the balance is zero');
        // releaseAmount must be lt or equal rewardsAmount
        require(releaseAmount <= info.rewardsAmount, 'CommunityRewards: the withdrawal amount exceeds the balance');

        token.safeTransferFrom(tokenWallet, rewardsToken, releaseAmount);
        info.rewardsAmount = info.rewardsAmount.sub(releaseAmount);

        emit releaseEvent(tokenWallet, rewardsToken, releaseAmount);
    }

    function killSelf(address payable recipientToken) public onlyOwner {
        uint256 contractBalance = token.balanceOf(address(this));
        token.safeTransfer(recipientToken, contractBalance);

        selfdestruct(recipientToken);
    }
}

